import React from 'react';
import Offcanvas from 'react-bootstrap/Offcanvas';
import sunmenuStyle from './Sun_menu.module.scss';
import sunaniStyle from './Sun_animation.module.scss';

import { useState } from 'react';


const Sun = ({checked}, ...props) => {
    const [show, setShow] = useState(false);

    const handleClose = () => setShow(false);
    const toggleShow = () => setShow((s) => !s);

    return (
        <>
        {checked ? <div id={aniStyle.sun_animode}/>  : 
        <div onClick={toggleShow} className="me-2" id={menuStyle.sun_menumode}>
        </div>}

        <Offcanvas id={menuStyle.Offcanvas} show={show} onHide={handleClose} {...props}>
        <Offcanvas.Header className={menuStyle.Offcanvas_Header} closeButton closeVariant="white">
        </Offcanvas.Header>
        <Offcanvas.Title className={sunmenuStyle.Offcanvas_Title}>About Me</Offcanvas.Title>
        <Offcanvas.Title className={sunmenuStyle.Offcanvas_Title}>Skills</Offcanvas.Title>
        <Offcanvas.Title className={menuStyle.Offcanvas_Title}>Projects</Offcanvas.Title>
        <Offcanvas.Title className={menuStyle.Offcanvas_Title}>Contact Me</Offcanvas.Title>
        <Offcanvas.Title className={menuStyle.Offcanvas_Title}>Education</Offcanvas.Title>
        <Offcanvas.Title className={menuStyle.Offcanvas_Title}>Others</Offcanvas.Title>
        <Offcanvas.Title className={menuStyle.Offcanvas_Title}>1</Offcanvas.Title>
        <Offcanvas.Title className={menuStyle.Offcanvas_Title}>2</Offcanvas.Title>
        </Offcanvas>
    </>
    );
};

export default Sun;
